- input: "TEXT\x1CC00035600\x1CX0\x1C\x1CF3XA\x1CAmendment 2 - This amendment is being
    filed to reflect changes to the memoed transactions for the Committee for Change
    Joint Fundraiser.  Amendment 1 - Prior to this amendment, the Committee filed
    a response to the Commission's letter dated November 21, 2008 regarding the Committee's
    October monthly report.  Question 1 - Expenses for Design, Production, Postage/Exempt
    Mail/Obama and Postage/Exempt Mail/Obama disclosed on Schedule B for Line 30B
    met the definition of exempt activity and no DNC funds were used to pay for these
    activities.  Expenses for Buttons-not public communication, Posters-not public
    communication, stickers-not public communication and T-shirts-not public communication
    disclosed on Schedule B for Line 21B were properly reported on 21B because they
    did not meet the definition of Federal Election activity or constitute a public
    communication.  Question 2 - The activities disclosed as Brochure-not public communication
    and Literature-not public communication were properly reported on Line 21B because
    they did not meet the definition of Federal Election activity or constitute a
    public communication.  Question 3 - Expenditures for phones disclosed on Line
    30b were for both generic GOTV and exempt volunteer phones for Barack Obama.  Expenses
    for Design, Production, Postage/Exempt Mail Obama and Postage/Exempt Mail/Obama
    disclosed on Line 30B met the definition of exempt activity and contained express
    advocacy for Barack Obama.  This report also includes in-kind contributions that
    were inadvertently omitted from the original report.  Original Report - The Committee
    disclosed payments for Salaries/Wages for this period on Schedule H4 for Line
    21a, and Schedule B for Line 30b.  The Committee paid its employees with 100%
    federal funds, and disclosed the expenditures on Line 30b when the individual
    spent more than 25% of their compensated time in a given month on Federal election
    activity or activities in connection with a Federal election.  Those individuals
    who spend 25% or less of their compensated time in a given month on Federal election
    activity or activities in connection with a Federal election are paid with Federal
    funds, and allocated on Schedule H4.  In either case, all amounts spent for employee
    specific 'fringe benefits,' consisting of health insurance, disability insurance,
    life insurance, retirement benefits and payroll taxes are paid for, and reported
    on a proportional basis equal to the amount associated with the individual that
    received the compensation and the funds with which the individual was paid.  Any
    reimbursements/allocation transfers to the Committee's federal account from the
    Committee's non-federal account for salaries, and/or benefits are associated with
    individuals whose activities do not exceed 25% in a given month.  Receipts reported
    on Schedule A for Line 17, unless otherwise noted, are for the purchase of access
    to the Committee's voter file.  The Committee believes that this price properly
    reflects the fair market value of the file, which represents the normal charge
    for such data in our state.  All costs associated with the voter file are paid
    100% out of the federal account and are therefore not allocable.  Payments listed
    on Schedule H4 for office supplies were payments either to vendors, or as reimbursements
    to individuals for basic supplies used for day-to-day operations.  These items
    included, but are not limited to pens, paper, paper clips, pencils, ink, toner,
    video tapes, CDs, cups, toilet paper, paper towels, tissues, trash bags, coffee,
    tape, extension cords, light bulbs, labels, folders, organizers, envelopes, cartridges,
    soap, cleaning products, etc...\n"
